import styles from '../styles/Releases.module.css';
import Header from './header';

export default function Purchase() {
  return (
    <div className={styles.container}>
      <Header />
      <h1>Releases</h1>
      <div>
        <div>
          <a>
            <img src="/hawaii_part_ii.jpg" />
          </a>
        </div>
      </div>
    </div>
  );
}
